import React from "react";
import { ToggleWrapper } from "../style/ToggleButton.style";

const ToggleButton = ({
  children,
  disabled,
  className,
  fullWidth,
  ...otherProps
}) => {
  return (
    <ToggleWrapper>
      {/* <button
      // disabled={disabled}
      // className={className}
      // fullWidth={fullWidth}
      // {...otherProps}
      >
        {children}
      </button> */}
    </ToggleWrapper>
  );
};

export default ToggleButton;
